import React from 'react';
//Import Component
import Todo from './Todo.js'

const TodoList = () => {
    return(
        <div className="todo-container">
            <ul className="todo-list">
                <Todo />
                <Todo />
                <Todo />
            </ul>
        </div>

    );

}

export default TodoList;
